import React from 'react'
import Head from 'next/head'
import { MissionCard } from '../components/Mission';
import { Container } from '../components/Layout';
import Nav from '../components/Nav/Nav';

import STACKS_LIST from '../constants/stacks';
import MISSIONS_LIST from '../constants/missions';
import { SectionHeader } from '../components/Title';
import ImageLayout from '../components/Layout/ImageLayout';
import Header from '../components/Header';

const menuConfig = [
  {
    href: '/',
    label: 'Accueil',
  },
  {
    href: '/projets',
    label: 'Projets',
  },
  {
    href: '#',
    label: 'Articles',
  },
  {
    href: '#',
    label: 'Contact',
  },
]

const Home = () => (
  <div>
    <Head>
      <title>Home</title>
      <link rel='icon' href='/favicon.ico' />
    </Head>
    <div className="container mx-auto">
      <Header items={menuConfig}/>
      <Nav items={menuConfig} />
      <SectionHeader title="Ce que je sais faire" overlay="WHAT CAN I DO" />

        <div class="grid grid-cols-5 gap-6">
          {STACKS_LIST.map(stack => (
            <div class="max-w-sm my-4 rounded overflow-hidden shadow">
              <div class="px-6 py-4">
                <div className="mb-6 flex justify-center">
                  <ImageLayout colored>
                    <img src={stack.logo} />
                  </ImageLayout>
                </div>
                <div class="font-bold text-xl mb-2">{stack.name}</div>
                <p class="text-gray-700 text-base">
                  {stack.description}
                </p>
              </div>
            </div>
          ))}
        </div>

        <SectionHeader title="J'ai travaillÃ© pour" overlay="I have worked for" />
    <Container centered padded>
        {MISSIONS_LIST.map(({ description1, description2, ...mission })=> (
          <MissionCard {...mission}>
            {description1}
            <br /><br />
            {description2}
          </MissionCard>
        ))}
      </Container>
    </div>
  </div>
)

export default Home
